import React from "react";
import { FaBars, FaTimes } from "react-icons/fa";

export default function Topbar() {
  return (
    <div>
      <h3>SOMESH</h3>
      <nav>
        <a>Home</a>
        <a>My Work</a>
        <a>About me</a>
        <button>
          <FaTimes />
        </button>
      </nav>
      <button>
        <FaBars />
      </button>
    </div>
  );
}
